episodes.description:
One of the most eloquent descriptions of a person's physiology as they escape from a cult. 
e.g. 'eyes staring at you behind that's almost pulling you back';
'the weight slowly drops into your stomach, the further you go the lighter you feel';
'a lightness of being and freedom'.

The cult in question is the Children of God. The clip is from the documentary Children of the Cult.
